import React, { Component } from "react";
import ShowTodo from "./ShowTodo";
import AddTodo from "./AddTodo";
class TodoApp extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <ShowTodo />
        <AddTodo />
      </React.Fragment>
    );
  }
}

export default TodoApp;
